    overflowY: 'scroll',
    backgroundColor: '#e0e0e0',
    borderRadius: '8px',
    padding: '10px',
    boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.2)',
  },
  history: {
    fontSize: '16px',
    fontWeight: 'bold',
